import { useEffect, useState } from "react";
import "./Tracks.css";
import axios from "axios";

function Tracks() {
  const [cards, setCards] = useState([])

  const getData = async () => {
    const data = await axios({
      method: "get",
      url: "http://localhost:8000/cards"
    })
    setCards(data.data)
  }

  useEffect(() => {
    getData()
  }, [])

  console.log(cards);

  return 
}

export default Tracks;



